rx_packet_process() {
switch (FC->Type)
{
case FC_TYPE_DATA: // 数据帧
dev_rx_data_frm(pAd, pRxBlk);
break;
case FC_TYPE_MGMT: // 管理帧
dev_rx_mgmt_frm(pAd, pRxBlk);
break;
case FC_TYPE_CNTL: // 控制帧
dev_rx_ctrl_frm(pAd, pRxBlk);
break;
default:
RELEASE_NDIS_PACKET(pAd, pRxPacket,
NDIS_STATUS_FAILURE);
break;
}
}
